/* eslint-disable import/no-anonymous-default-export */
import "./Internacional.css";
import Vi from "../components/Vi";


import img09 from "../../../src/Foto/img/cancun.jpg";
import img10 from "../../../src/Foto/img/toquio.jpg";
import img11 from "../../../src/Foto/img/Dubai1.jpg";
import img12 from "../../../src/Foto/img/caribeHolandes.jpg";
import img13 from "../../../src/Foto/img/Madri.jpg";
import img14 from "../../../src/Foto/img/Bariloche .jpg";



export default () => {
    return(

<>
        <h3>Pacote de Viagem Internaconal</h3>

   <Vi Foto={img14 }  ></Vi>
   <Vi Foto={img09 }  ></Vi>
   <Vi Foto={img10 }  ></Vi>
   <Vi Foto={img11 }  ></Vi>
   <Vi Foto={img12 }  ></Vi>
   <Vi Foto={img13 }  ></Vi>
 

   </>
    );
}
